export const changePath = (input) => {
    return {
        type: "Path",
        state: input
    };
};

export const changeSession = (input) =>{
    return {
        type : "session",
        state : input

    }
}

export const decrementSession = () =>{
    return {
        type : "decrement"
    }
}
